function getQueryParam(param) {
    const urlParams = new URLSearchParams(window.location.search);
    return urlParams.get(param);
}
bb='data:image/png;base64,'


aa='';

const name = getQueryParam('name');
const score = parseFloat(getQueryParam('score'));
const dept = getQueryParam('dept');

let cgpa = 0;
cgpa = score*4/15;
cgpa = cgpa.toFixed(2);

if (cgpa >= 2.25){
    document.getElementById("headline").innerHTML = "CONGRATULATIONS!";
    document.getElementById("message").textContent = `Your CGPA is ${cgpa}`;

    document.getElementById("headline1").innerHTML = "CONGRATULATIONS!";
    document.getElementById("message1").textContent = `Your CGPA is ${cgpa}`;
}
else {
    document.title = "Sorry :(";
    document.getElementById("headline").innerHTML = "Sorry :(";
    document.getElementById("message").innerHTML = "You Failed!";

    document.getElementById("headline1").innerHTML = "Sorry :(";
    document.getElementById("message1").innerHTML = "You Failed!";

    document.getElementById("headline").style.marginLeft = "70px";
    document.getElementById("message").style.marginLeft = "70px";

    document.getElementById("headline1").style.marginLeft = "50px";
    document.getElementById("message1").style.marginLeft = "50px";

    document.getElementById("certificate").style.display = "none";
    document.getElementById("certificate1").style.display = "none";
}

// Function to create and download the PDF with a template
document.getElementById('certificate').addEventListener('click', () => {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF({
        orientation: 'landscape',   
        unit: 'mm',              
        format: 'a4' 
    });

    doc.addImage(bb, 'PNG', 0, 0,  297, 210);

    doc.addFileToVFS('HirarkiSignatureItalic.ttf', aa); 
    doc.addFont('HirarkiSignatureItalic.ttf', 'AstonScript', 'normal');
    doc.setFont('AstonScript');

    doc.setFontSize(30);

    const centerText = (text, y) => {
        const pageWidth = doc.internal.pageSize.getWidth();
        const textWidth = doc.getStringUnitWidth(text) * doc.internal.getFontSize() / doc.internal.scaleFactor;
        const textX = (pageWidth - textWidth) / 2;
        doc.text(text, textX, y);
    };

    centerText(`${name}`, 103);

    doc.setFont('helvetica', 'bold');
    doc.setFontSize(25);
    doc.text(`${cgpa}`, 240, 134);
    let a = doc.getStringUnitWidth(`${dept}`);
    console.log(`${a}`);
    if (doc.getStringUnitWidth(`${dept}`) <= 2){
        doc.text(`${dept}`, 133, 147);
    }
    else if (doc.getStringUnitWidth(`${dept}`) == 3){
        doc.text(`${dept}`, 130.5, 147);
    }
    else {
        doc.text(`${dept}`, 127, 147);
    }
    

    // Save the PDF
    doc.save('certificate.pdf');
});
    
